      // Feature name: AWB Misleading Zone Process v1.1.
      // Advanced outlier stat screening with misleading color zones.
      //
      // Variable name: awb_day_sum_threshold_count.
      // The number of stats based trigger points for varying size of misleading color zone
      // The stats with day decision contribute the stat count
      // Note: Only available in v1.0; Not in use in v1.1
      // Default value: 0.
      // Data range: 0 to 3072.
      //
      // Variable name: awb_flo_sum_threshold_count.
      // The number of stats based trigger points for varying size of misleading color zone
      // The stats with F decision contribute the stat count
      // Note: Only available in v1.0; Not in use in v1.1
      // Default value: 0.
      // Data range: 0 to 3072.
      //
      // Variable name: awb_misleading_color_zones.
      // Specify the information to control misleading color zone
      // Each misleading color zone has the following parameters:
      // (1) zone control
      // (2) trigger_type
      // (3) control_direction
      // (4) detect_zone
      //
      // Variable name: (1) zone_control.
      // Specify the control method of the corresponding misleading zone.
      // 0:ML_NO_ZONE_CHANGE
      // 1:ML_SHRINK_ZONE
      // 2:ML_EXPAND_ZONE
      // Default value: 0
      // Data range: 0 to 2
      //
      // Variable name: (2)trigger_type.
      // Specify trigger point for enabling the corresponding misleading zone.
      // 0:ML_NO_LINK
      // 1:ML_EXP_OUTDOOR
      // 2:ML_EXP_INDOOR
      // 3-12:ML_SUM_0 - ML_SUM_9 : ML_SUM[number], number means which "Misleading Sum Control Zone"
      //                            want to use for this mileading color zone.
      // Default value: 0.
      // Data range: 0 to 12
      //
      // Variable name: (3) control_direction.
      // Specify the direction of zone changes.
      // 0:ML_LEFT
      // 1:ML_RIGHT
      // 2:ML_TOP
      // 3:ML_BOTTOM
      // Default value: 0
      // Data range : 0 to 3
      //
      // Variable name: (4) detect_zone.
      // Rectangle zone misleading color zone with following parameters:
      // (a) rg_center
      // (b) bg_center
      // (c) rg_radius_grid
      // (d) bg_radius_grid
      // (e) EEPROM calibration data
      //
      // Variable name: (a) rg_center.
      // The center point of zone in horizontal axis.
      // Default value: 0.0
      // Data range: 0.0 to 2.0
      //
      // Variable name: (b) bg_center.
      // The center point of zone in vertical axis.
      // Default value: 0.0
      // Data range: 0.0 to 2.0
      //
      // Variable name: (c) rg_radius_grid.
      // The horizontal offset from the center point.
      // Default value: 0.
      // Data range: 0 to 241.
      //
      // Variable name: (d) bg_radius_grid.
      // The vertical offset from the center point.
      // Default value: 0.
      // Data range: 0 to 241.
      //
      // Variable name: (e) EEPROM (OTP) Calibration Index.
      //   0 : Apply D50 calibration ratio
      //   1 : Apply TL84 calibration ratio
      //   2 : Apply A calibration ratio
      // Data range: 0 to 2
      //
      // Variable name: exp_index_trigger.
      // Based on different trigger type, exposure index indicates if the current misleading color zone is used
      // or not under the current brightness value.
      // start need to be smaller than end
      // If trigger type set to between 2 and 10, the gain start and gain end will use for low light exp index threshold
      // Default value: {0.0, 0.0, 0, 0}.
      // Data range: >= 0.
      //
      // Variable name: enable_mlc_zone
      // Enable/Disable misleading color zone
      // Default value: 0
      // Data range: 0 - Disable, 1 - Enable
      //
      // Variable name: Valid misleading color zones
      // The total number of valid misleading color zones
      // Default value: 0
      // Data range: 30
      //
      // Variable name: Misleading Sum Control Zone
      // The information for specifying sub-decision zones
      // The stat in these zones can contribute the misleading color zone with sum control
      // The following parameters are required to set up this Sum Control Zone:
      // (1) enable misleading sum control zone
      // (2) Misleading color stat zones
      // (3) Sum threshold for decrease ratio
      // (4) Auxiliary sub zones for collecting stats
      //
      // Variable name: (1) enable misleading sum control zone
      // Enable/Disable misleading sum control zone
      // Default value: 0
      // Data range: 0 - Disable, 1 - Enable
      //
      // Variable name: (2) Misleading Color Stats Zones
      // /* Subzone 0-11 */ ==> control region_cnt[0]to region_cnt[11]
      // Control method: 12 bits data => 0000 0000 0000 ==> bit[0] control region_cnt[11], bit[1] control region_cnt[10]....bit[11] control region_cnt[0].
      //                 For example, if want only want to include region_cnt[1] and region_cnt[11] for stats count,
      //                 /* Subzone 0-11 */ can be set for "1000 0000 0010" = 2050
      // /* Subzone 12-23 */ ==> control region_cnt[12]to region_cnt[23]
      // Control method: 12 bits data => 0000 0000 0000 ==> bit[0] control region_cnt[23], bit[1] control region_cnt[22]....bit[11] control region_cnt[12].
      //                 For example, if want only want for include region_cnt[14] and region_cnt[22] for stats count,
      //                 /* Subzone 12-23 */ will be set for "0010 0000 0010" = 514
      // /* Subzone 24-35 */ ==> control region_cnt[24]to region_cnt[35]
