         /*********************************************************************/
         // Variable name: sensitivity
         // Description: Sensitivity of the image sensor module
         // Default value : 1
         // Data range: (0, 5]
         // Constraint: Contact vendor module to know the exact value sensitivity,
         // also make sure to enable the flag use_custom_sensitivity to use
         // this value, else the TOF algorithm calculates the sensitivity on its
         // own.
         //
         // Variable name: outdoor_lux_idx
         // Description: Threshold to determine the outdoor light level so as
         // to switch from TOF to Contrast AF
         // Default value : 183
         // Data range: 0 to 500
         // Effect: Below this threshold, Contrast AF will be active.
         // Above the threshold Laser AF will be active
         // Constraints: Check the chromatix header to know the exact lux
         // index threshold for bright light or outdoor light condition
         //
         // Variable name: jump_to_start_limit
         // Description: Step size to Jump to the start position of fine search
         // in normal light level
         // Default value : 50
         // Data range: 0 to 300
         // Effect: Higher the number faster the AF speed, but will give
         // jerky user experience
         //
         // Variable name: jump_to_start_limit_low_light
         // Description: Step size to Jump to the start position of fine search
         // in low light level
         // Default value : 60
         // Data range: 0 to 300
         // Effect: Higher the number faster the AF speed, but will give
         // jerky user experience
         //
         // Variable name: start_pos_for_tof
         // Description: Starting lens position when the camera is launched
         // Default value : Lens position at SINGLE_HYP_F_IDX
         // Data range: Lens position[SINGLE_NEAR_LIMIT_IDX, SINGLE_FAR_LIMIT_IDX]
         //
         // Variable name: far_converge_point
         // Description: Starting Lens position when TOF focuses from the far direction
         // and when TOF is not confident
         // Default value : Lens position at SINGLE_HYP_F_IDX
         // Data range: Lens position[SINGLE_NEAR_LIMIT_IDX, SINGLE_FAR_LIMIT_IDX]
         //
         // Variable name: normal_light_cnt
         // Description: Number of frames to monitor to detect scene change in bright
         // light level condition.
         // Default value : 5
         // Data range: [0 100]
         // Effect: Higher the number harder to detect scene change
         //
         //
         // Variable name: lowlight_cnt
         // Description: Number of frames to monitor to detect scene change in low
         // light level condition.
         // Default value : 3
         // Data range: [0 100]
         // Effect: Higher the number harder to detect scene change
         //
         // Variable name: tof_step_size
         // Description: Step size to be used for fine search in bright
         // light level condition.
         // Default value : 6
         // Data range: [0 100]
         // Effect: Higher the number faster the AF speed but the accuracy
         // may get effected
         //
         // Variable name: median_filter_enable
         // Description: Flag to run the median filter on the TOF raw data
         // Default value : 0
         // Data range: [0 1]
         // Effect: Enabling this flag to make median filter to be run on raw
         // TOF data so as to reduce the noise in the TOF data, but running
         // median filter would cause the delay in response.
         //
         // Variable name: median_filter_num_of_samples
         // Description: Number of frames to run the median filter
         // Default value : 5
         // Data range: [0 100]
         // Constraint : The number of frames has to be always odd for median filter
         // Effect: Higher the number slower the response but chances of reducing
         // the noise is more
         //
         // Variable name: average_filter_enable
         // Description: Flag to run the averaging filter on the TOF raw data
         // Default value : 0
         // Data range: [0 1]
         // Effect: Enabling this flag to make average filter to be run on raw
         // TOF data so as to reduce the noise in the TOF data, but running
         // average filter would cause the delay in response.
         //
         // Variable name: average_filter_num_of_samples
         // Description: Number of frames to run the average filter
         // Default value : 0
         // Data range: [0 1]
         // Effect: Higher the number slower the response but chances of reducing
         // the noise is more
         //
         // Variable name: use_custom_sensitivity
         // Description: Flag to use the sensitivity from the header file rather
         // than using algorithm's default sensitivity
         // Default value : 0
         // Data range: [0 1]
         // Effect: If enabled, TOF algorithm reads sensitivity value from the
         // header, else TOF algorithm calculates the sensitivity by default
         //
         // Variable name: enable_sad_when_tof_is_conf
         // Description: Flag to use SAD even when TOF is confident
         // Default value : 0 for camcorder, 1 for preview
         // Data range: [0 1]
         // Effect: If disabled, SAD wont be used as scene change detection
         // metric when TOF is confident
         //
         // Variable name: run_tof_in_outdoor_light_flag
         // Description: Flag to run TOF even in outdoor light level
         // Default value : 0
         // Data range: [0 1]
         //
         // Variable name: aec_wait_check_flag_enable
         // Description: Flag to check AEC wait before trigger AF search
         // Default value : 0
         // Data range: [0 1]
         // Effect: If enabled, AF speed will be effected but accuracy will
         // be improved.
         //
         // Variable name: far_scene_coarse_srch_enable
         // Description: Flag to use to Contrast AF when TOF is not confident
