         //
         // Feature: AF tuning parameters specific to Sum of
         // Absolute Difference (SAD) scene detection. This settings is
         // specific only when TOF is running
         //
         // Variable name: enable.
         // Enable/disable SAD scene-detection mechanism.
         // Default value: 1.
         // Data range: 0 or 1.
         //
         // Variable name: gain_min.
         // Minimum gain.
         // Default value: 2.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: gain_max.
         // Maximum gain.
         // Default value: 30.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: ref_gain_min.
         // Minimum reference gain.
         // Default value: 2.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: ref_gain_max.
         // Maximum reference gain.
         // Default value: 30.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: threshold_min.
         // Threshold when current gain is less than min gain.
         // Default value: 5.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: threshold_max.
         // Threshold when current gain is more than max gain.
         // Default value: 10.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: ref_threshold_min.
         // Threshold when current gain is less than min reference gain.
         // Default value: 15.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: ref_threshold_max.
         // Threshold when current gain is more than max reference gain.
         // Default value: 20.0
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: unstable_count_th.
         // Number of frames to detect the scene change
         // Default value: 5.
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: stable_count_th.
         // Number of frames to detect the scene to be stable
         // Default value: 5.
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: frames_to_wait.
         // Frames to wait before storing reference luma.
         // Default value: 5.
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: grid_region_start.
         // Start of AEC grid configuration. There are total of
         // 16*16 grid, hence to choose the center ROI, choose
         // start grid as 4 and end_grid as 8, if we want the
         //	whole frame then put start grid as 16 and
         //	end grid as 16.
         // Default value: 4.
         // Data range: 1 to 16.
         //
         // Variable name: grid_region_end.
         // End of AEC grid configuration. There are total of
         // 16*16 grid, hence to choose the center ROI, choose
         // start grid as 4 and end_grid as 8, if we want the
         //	whole frame then put start grid as 16 and
         //	end grid as 16.
         // Default value: 8.
         // Data range: 1 to 16.
         //
         // Variable name: sadr_threshold_scaler.
         // Scalar multiplier to the sadr threshold. This is used
         // to detect scene change during AF search.
         // Default value: 6.
         // Data range: 0 to 100.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: aec_gain_input.
         // Levels of aec gain input to determine the sadr_threshold_scaler_multiplier
         // Default value: {0, 5, 15, 20, 25}
         // Data range: 0 to 30.
         //
         // Variable name: sadr_threshold_scaler_multiplier.
         // Scalar multiplier to the sadr threshold. This is used to detect
         // scene change during AF search. This multiplier value is
         // multiplied with sadr_threshold_scaler to calculate the final
         // multiplier based on the aec_gain
         // to detect scene change during AF search.
         // Default value: {1, 0.5, 0.3, 0.2, 0.15}
         // Data range: 0 to 5.
         // Effect: Larger the number, harder to trigger.
         //
         // Variable name: scene_change_distance_thres
         // Description: Distance in mm difference treated as scene change
         // Default value : {20, 40, 60, 80, 90, 100, 110, 120}
         // Data range: [0 1000]
         // Effect: Larger the number, less sensitive of scene change
         //
         // Variable name: scene_change_distance_std_dev_thres
         // Description: Standard deviation of distance across num_monitor_samples
         // Default value : 30
         // Data range: [0 100]
         // Effect: Larger the number, easy to trigger scene change
         //
         // Variable name: distance_region
         // Description: Divide the distance in mm range to DOF regions, each part will have
